void CM<3, EmpiricalAdapter>::apply(float* f, float* f_eq, float* u, float* force, int node) {
    float ux = u[get_vec_index(node, 0)];
    float uy = u[get_vec_index(node, 1)];
    float uz = u[get_vec_index(node, 2)];

    float Fx = force[get_vec_index(node, 0)];
    float Fy = force[get_vec_index(node, 1)];
    float Fz = force[get_vec_index(node, 2)];

    float rho = 0.0f;
    float lambdas[4] = {0.0f};
    float k[23]; //k1..k4 (inclusive) are not used in the formula because they are conserved moments.
    float old_f[27];
    float S_xx = 0.0f, S_xy = 0.0f, S_xz = 0.0f,
          S_yy = 0.0f, S_yz = 0.0f, S_zz = 0.0f;

    for (int i = 0; i < quadratures; i++) {
        float cx = C[3*i] - ux;
        float cy = C[3*i+1] - uy;
        float cz = C[3*i+2] - uz;
        float cx2 = cx * cx;
        float cy2 = cy * cy;
        float cz2 = cz * cz;

        float f_i = f[get_node_index(node, i)];
        float f_i_eq = f_eq[get_node_index(node, i)];
        float f_i_neq = f_i - f_i_eq;  // Non-equilibrium part

        rho += f[get_node_index(node, i)];
        old_f[i] = f[get_node_index(node, i)];

        // Compute contributions to the strain rate tensor
        S_xx += f_i_neq * cx * cx;
        S_yy += f_i_neq * cy * cy;
        S_zz += f_i_neq * cz * cz;
        S_xy += f_i_neq * cx * cy;
        S_xz += f_i_neq * cx * cz;
        S_yz += f_i_neq * cy * cz;

        // k[i - 4] for the i to match T[i] from De Rosis Formulations
        k[4 - 4]  = f_i * (cx * cy);
        k[5 - 4]  = f_i * (cx * cz);
        k[6 - 4]  = f_i * (cy * cz);
        k[7 - 4]  = f_i * (cx2 - cy2);
        k[8 - 4]  = f_i * (cx2 - cz2);
        k[9 - 4]  = f_i * (cx2 + cy2 + cz2);
        k[10 - 4] = f_i * (cx * cy2 + cx * cz2);
        k[11 - 4] = f_i * (cx2 * cy + cy * cz2);
        k[12 - 4] = f_i * (cx2 * cz + cy2 * cz);
        k[13 - 4] = f_i * (cx * cy2 - cx * cz2);
        k[14 - 4] = f_i * (cx2 * cy - cy * cz2);
        k[15 - 4] = f_i * (cx2 * cz - cy2 * cz);
        k[16 - 4] = f_i * (cx * cy * cz);
        k[17 - 4] = f_i * (cx2 * cy2 + cx2 * cz2 + cy2 * cz2);
        k[18 - 4] = f_i * (cx2 * cy2 + cx2 * cz2 - cy2 * cz2);
        k[19 - 4] = f_i * (cx2 * cy2 - cx2 * cz2);
        k[20 - 4] = f_i * (cx2 * cy * cz);
        k[21 - 4] = f_i * (cx * cy2 * cz);
        k[22 - 4] = f_i * (cx * cy * cz2);
        k[23 - 4] = f_i * (cx * cy2 * cz2);
        k[24 - 4] = f_i * (cx2 * cy * cz2);
        k[25 - 4] = f_i * (cx2 * cy2 * cz);
        k[26 - 4] = f_i * (cx2 * cy2 * cz2);
    }

    const float cs2 = 1.0f / 3.0f;

    float s2 = 2.0f * (S_xx * S_xx + S_yy * S_yy + S_zz * S_zz +
                                       2.0f * (S_xy * S_xy + S_xz * S_xz + S_yz * S_yz));
    float u_grad_mag = sqrtf(s2);
    float u_mag = sqrtf(ux*ux + uy*uy + uz*uz);

    float lambda[4];

    EmpiricalAdapter::compute_higher_order_relaxation(rho, u_grad_mag, lambda, d_moment_avg);

