    f[1] = (1.0f/4.0f)*Fx*(2.0f*ux - 2.0f*uxuy2 - 2.0f*uxuz2 - uy2 + uy2uz2 + 2.0f*uy2uz2ux - uz2 + 1.0f) - 1.0f/2.0f*Fy*(ux2uy - ux2uz2uy + uxuy - uz2uxuy) + (1.0f/2.0f)*Fz*(ux2uy2uz - ux2uz - uxuz + uy2uxuz) + (1.0f/4.0f)*k[13]*(lambda[0] - 1.0f)*(2.0f*uxuy2 - 2.0f*uxuz2 + uy2 - uz2) + (1.0f/2.0f)*k[14]*(lambda[0] - 1.0f)*(ux2uy + uxuy + uy - uyuz2) + (1.0f/2.0f)*k[15]*(lambda[0] - 1.0f)*(ux2uz + uxuz - uy2uz + uz) - 2.0f*k[16]*(lambda[0] - 1.0f)*(2.0f*uxuyuz + uyuz) + (1.0f/4.0f)*k[19]*(lambda[1] - 1.0f)*(uy2 - uz2) - 2.0f*k[20]*uyuz*(lambda[1] - 1.0f) - k[21]*(lambda[1] - 1.0f)*(2.0f*uxuz + uz) - k[22]*(lambda[1] - 1.0f)*(2.0f*uxuy + uy) + (1.0f/2.0f)*k[26] + k[4]*(omega - 1.0f)*(2.0f*uxuy + uy - uyuz2 - 2.0f*uz2uxuy) + k[5]*(omega - 1.0f)*(2.0f*uxuz - 2.0f*uy2uxuz - uy2uz + uz) - 2.0f*k[6]*(omega - 1.0f)*(ux2uyuz + uxuyuz) - 1.0f/6.0f*k[7]*(omega - 1.0f)*(ux + ux2 + ux2uy2 - 2.0f*ux2uz2 + uxuy2 - 2.0f*uxuz2 - uy2 + uy2uz2 - uz2 + 1.0f) - 1.0f/6.0f*k[8]*(omega - 1.0f)*(ux + ux2 - 2.0f*ux2uy2 + ux2uz2 - 2.0f*uxuy2 + uxuz2 - uy2 + uy2uz2 - uz2 + 1.0f) - 1.0f/54.0f*lambda[3]*(27.0f*k[26] - rho) + (1.0f/2.0f)*rho*(ux + ux2 - ux2uy2 + ux2uy2uz*uz - ux2uz2 - uxuy2 - uxuz2 + uy2uz2ux) - 1.0f/18.0f*uy*(Fy*(lambda[2] - 2.0f) + 18.0f*k[24]*lambda[2] - 18.0f*k[24]) - 1.0f/18.0f*uz*(Fz*(lambda[2] - 2.0f) + 18.0f*k[25]*lambda[2] - 18.0f*k[25]) + (1.0f/24.0f)*(3.0f*k[17] - lambda[1]*(3.0f*k[17] - rho))*(2.0f*ux + 2.0f*ux2 + uy2 + uz2 - 2.0f) - 1.0f/72.0f*(9.0f*k[18] - lambda[1]*(9.0f*k[18] - rho))*(2.0f*ux + 2.0f*ux2 - uy2 - uz2 + 2.0f) + (1.0f/6.0f)*(k[9] - lambda[0]*(k[9] - rho))*(-2.0f*ux - 2.0f*ux2 + ux2uy2 + ux2uz2 + uxuy2 + uxuz2 - uy2 + uy2uz2 - uz2 + 1.0f) - 1.0f/36.0f*(2.0f*ux + 1.0f)*(Fx*(lambda[2] - 2.0f) + 18.0f*k[23]*lambda[2] - 18.0f*k[23]) - 1.0f/12.0f*(Fx*(lambda[0] - 2.0f) + 3.0f*k[10]*lambda[0] - 3.0f*k[10])*(-4.0f*ux + 2.0f*uxuy2 + 2.0f*uxuz2 + uy2 + uz2 - 2.0f) - 1.0f/6.0f*(Fy*(lambda[0] - 2.0f) + 3.0f*k[11]*lambda[0] - 3.0f*k[11])*(ux2uy + uxuy - uy + uyu